async function a(){document.getElementById("vehicle_year").value,await fetch("https://vpic.nhtsa.dot.gov/api//vehicles/GetMakesForVehicleType/moto?format=json").then(o=>{const n=o.json();if(console.log(n),!n.Results||n.Results.length===0){const e=document.getElementById("vehicle_make");e.innerHTML="";const t=document.createElement("option");t.value="",t.text="No makes found",e.appendChild(t)}n.Results.forEach(e=>{const t=document.getElementById("vehicle_make"),c=document.createElement("option");c.value=e.MakeName,c.text=e.MakeName,t.appendChild(c)})}).catch(o=>{console.log(o)})}function l(){document.getElementById("vehicle_year").value,document.getElementById("vehicle_make").value}document.getElementById("vehicle_year").addEventListener("change",a);document.getElementById("vehicle_make").addEventListener("change",l);
